import React from 'react';

function TechData() {
  return (
      <div className="tech-data">
	      	{props.tech-group}
	      	<ul>
	      		<li> Symfony </li>
	      		<li> ReactJS </li>
	      		<li> CodeIgniter </li>
	      	</ul>
      </div>
  );
}

export default TechData;
